import axios from 'axios';

const fetchData = async () => {
    try {
        const response = await axios.get('http://localhost:8000/');
        console.log(response.data); // Should log "CORS is working"
    } catch (error) {
        console.error("CORS error:", error);
    }
};

fetchData();
